import React from 'react';
import { styled } from '@mui/material/styles';
import { 
    Paper, 
    Table, 
    TableBody, 
    TableCell, 
    TableContainer, 
    TableHead, 
    TableRow,
    CircularProgress,
    Alert
} from '@mui/material';
import { useOptionChainData } from '../../features/optionChain/hooks/useOptionChainData';
import { OptionData } from '../../types/options';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    padding: theme.spacing(1),
    textAlign: 'center',
    '&.positive': {
        color: theme.palette.success.main,
    },
    '&.negative': {
        color: theme.palette.error.main,
    },
}));

interface Props {
    symbol: string;
    expiry?: string;
}

export const OptionChainGrid: React.FC<Props> = ({ symbol, expiry }) => {
    const { data, loading, error } = useOptionChainData(symbol, expiry);

    if (loading) {
        return <CircularProgress />;
    }

    if (error) {
        return <Alert severity="error">{error.message}</Alert>;
    }

    if (!data) {
        return <Alert severity="info">No data available</Alert>;
    }

    const formatValue = (value: number) => value.toFixed(2);
    const getChangeClass = (change: number) => change >= 0 ? 'positive' : 'negative';

    return (
        <TableContainer component={Paper}>
            <Table size="small">
                <TableHead>
                    <TableRow>
                        <StyledTableCell colSpan={6}>CALLS</StyledTableCell>
                        <StyledTableCell>Strike</StyledTableCell>
                        <StyledTableCell colSpan={6}>PUTS</StyledTableCell>
                    </TableRow>
                    <TableRow>
                        {['OI', 'Volume', 'IV', 'LTP', 'Δ', 'θ'].map((header) => (
                            <StyledTableCell key={`call-${header}`}>{header}</StyledTableCell>
                        ))}
                        <StyledTableCell>Price</StyledTableCell>
                        {['OI', 'Volume', 'IV', 'LTP', 'Δ', 'θ'].map((header) => (
                            <StyledTableCell key={`put-${header}`}>{header}</StyledTableCell>
                        ))}
                    </TableRow>
                </TableHead>
                <TableBody>
                    {data.strikes.map((strike) => {
                        const callKey = `${strike}_CE_${expiry}`;
                        const putKey = `${strike}_PE_${expiry}`;
                        const call = data.options[callKey];
                        const put = data.options[putKey];

                        return (
                            <TableRow key={strike}>
                                {/* Call Option Data */}
                                <StyledTableCell>{formatValue(call?.oi || 0)}</StyledTableCell>
                                <StyledTableCell>{formatValue(call?.volume || 0)}</StyledTableCell>
                                <StyledTableCell>{formatValue(call?.iv || 0)}</StyledTableCell>
                                <StyledTableCell className={getChangeClass(call?.change || 0)}>
                                    {formatValue(call?.last_price || 0)}
                                </StyledTableCell>
                                <StyledTableCell>{formatValue(call?.delta || 0)}</StyledTableCell>
                                <StyledTableCell>{formatValue(call?.theta || 0)}</StyledTableCell>

                                {/* Strike Price */}
                                <StyledTableCell>{strike}</StyledTableCell>

                                {/* Put Option Data */}
                                <StyledTableCell>{formatValue(put?.oi || 0)}</StyledTableCell>
                                <StyledTableCell>{formatValue(put?.volume || 0)}</StyledTableCell>
                                <StyledTableCell>{formatValue(put?.iv || 0)}</StyledTableCell>
                                <StyledTableCell className={getChangeClass(put?.change || 0)}>
                                    {formatValue(put?.last_price || 0)}
                                </StyledTableCell>
                                <StyledTableCell>{formatValue(put?.delta || 0)}</StyledTableCell>
                                <StyledTableCell>{formatValue(put?.theta || 0)}</StyledTableCell>
                            </TableRow>
                        );
                    })}
                </TableBody>
            </Table>
        </TableContainer>
    );
};
